import React from 'react';
import logo from './MYtineraryLogo.png';
import arrow from './circled-right-2.png'
import home from './homeIcon.png'
import './main.css';
import Users from './users'

import { Route, Link, BrowserRouter as Router } from 'react-router-dom'

function Main() {
  return (

    <div className="Main">
      <header className="Main-header">
        <img src={logo} className="Main-logo" alt="logo" />
      </header>
      <body className="Main-body">
        <p className="desc">Find your perfect trip, designed by insiders who know and love their cities.</p>
        <h2>Start browsing</h2>
        <Link to="/users" component={Users}><img src={arrow} className="Main-arrow" alt="Arrow" /></Link>
        <p>Want to build your own MYtinerary?</p>
        <p className="login">Log In</p><p className="register">Create Account</p>
      </body>
      <footer className="Main-footer">
        <img src={home} className="Main-footer" alt="Home" />
      </footer>
    </div>
  );
}
export default Main;
